import React from 'react';
import { Link } from 'react-router-dom';

const Navigation = () => {
    return (
        <div className="navigation">
            <ul className="nav-ul">
                <Link to="/about">About</Link>
                <Link to="/login">Login</Link>
            </ul>
        </div>
    )
};

export default Navigation;
